import React, { Component } from 'react';
import './App.css'
import * as styles from './styles';


class App extends Component {

  render() {
    const var1 = {
      key1:'some data'
    }
    return (
      <div className="App">
        {var1.key1}
      </div>
    );
  }

}

export default App;
